import React from 'react';
import classnames from 'classnames';
import styles from './Item.module.css';

const Item = ({value, isDone}) => (<label for="checkbox" className={
    classnames({
        [styles.item]: true,
        [styles.done]: isDone
    })
}>
    {value}
</label>);

export default Item;
